('6d3449a3-2c2e-498f-a7ad-a520b7a15c6a', 1, 'Google', 'tagManagerHead', '<!-- Google tag (gtag.js) -->\n<script async src=\"https://www.googletagmanager.com/gtag/js?id=G-XXXXXXXXXX\"></script>\n<script>\n  window.dataLayer = window.dataLayer || [];\n  function gtag(){dataLayer.push(arguments);}\n  gtag(\'js\', new Date());\n  gtag(\'config\', \'G-XXXXXXXXXX\');\n</script>', 'textarea', 1, 'The Google Tag Manager <head> tag is a JavaScript snippet placed in the <head> section that loads the GTM container and enables tag management without direct code modifications.', NULL, 8, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
('7217e1df-5d3a-43ba-8dd8-5741afd7af74', 0, 'i18n', 'locale', 'en_GB', 'select', 0, 'This setting determines the default language for the admin area, allowing users to select languages such as French or German.', '{\n  \"de_DE\": \"German\",\n  \"fr_FR\": \"French\",\n  \"es_ES\": \"Spanish\",\n  \"it_IT\": \"Italian\",\n  \"pt_PT\": \"Portuguese\",\n  \"nl_NL\": \"Dutch\",\n  \"pl_PL\": \"Polish\",\n  \"ru_RU\": \"Russian\",\n  \"sv_SE\": \"Swedish\",\n  \"da_DK\": \"Danish\",\n  \"fi_FI\": \"Finnish\",\n  \"no_NO\": \"Norwegian\",\n  \"el_GR\": \"Greek\",\n  \"tr_TR\": \"Turkish\",\n  \"cs_CZ\": \"Czech\",\n  \"hu_HU\": \"Hungarian\",\n  \"ro_RO\": \"Romanian\",\n  \"sk_SK\": \"Slovak\",\n  \"sl_SI\": \"Slovenian\",\n  \"bg_BG\": \"Bulgarian\",\n  \"hr_HR\": \"Croatian\",\n  \"et_EE\": \"Estonian\",\n  \"lv_LV\": \"Latvian\",\n  \"lt_LT\": \"Lithuanian\",\n  \"uk_UA\": \"Ukrainian\",\n  \"en_GB\": \"British English\"\n}', 2, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
('76ba10cb-9443-4925-b92f-99630cccad25', 2, 'Security', 'trustedProxies', '', 'textarea', 0, 'List of trusted proxy IP addresses (one per line). Only requests from these IPs will have their forwarded headers honored when trustProxy is enabled. Leave empty to trust all proxies (not recommended for production).', NULL, 6, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
('77387d30-91b2-4f3c-aaf5-299de4d2e772', 2, 'Comments', 'pagesEnabled', '0', 'bool', 0, 'Turn this on to enable logged in users to comment on your pages.', NULL, 2, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
