('8528e5d0-83be-46d6-bc17-5ae721426c21', 1, 'AI', 'enabled', '0', 'bool', 0, 'Harness the power of artificial intelligence to enhance your content creation process. By enabling AI features, you gain access to a range of powerful tools, such as automatic article summarization, SEO metadata generation, and multilingual translation.', NULL, 2, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
('8af0423b-89b7-45e9-82c3-c64bc318b9da', 5, 'ImageSizes', 'small', '200', 'numeric', 0, 'The width for the small image size.', NULL, 2, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
