('9035f116-923e-406e-9d97-a86492309189', 12, 'RateLimit', 'adminNumberOfRequests', '40', 'numeric', 0, 'Maximum admin area requests allowed within the time window.', NULL, 2, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
('90dce233-bba3-4791-9c1f-b87bc2dc778b', 25, 'Translations', 'uk_UA', '0', 'bool', 0, 'Enable translations in Ukrainian', NULL, 2, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
('93c23100-8b43-446b-9877-837fb8a2ca43', 1, 'RateLimit', 'numberOfSeconds', '60', 'numeric', 0, 'This field complements the \"Rate Limit: Number Of Requests\" setting by specifying the time window in which the request limit is enforced. It determines the duration, in seconds, for which the rate limit is applied. For example, if you set the \"Rate Limit: Number Of Requests\" to 100 and the \"Rate Limit: Number Of Seconds\" to 60, it means that an IP address can make a maximum of 100 requests within a 60-second window. If an IP address exceeds this limit within the specified time frame, they will be blocked for a certain period to prevent further requests and protect your server from potential abuse or overload.', NULL, 2, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
('a06b70d5-8a59-4307-98cb-53d6c11a2c30', 3, 'ImageSizes', 'large', '400', 'numeric', 0, 'The width for the large image size.', NULL, 2, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
('a438e051-873f-434e-aac7-7deebf4d7805', 2, 'SEO', 'siteMetaDescription', 'Default site meta description', 'textarea', 0, 'The site meta description is a brief summary of your website\'s content and purpose. It appears in search engine results below the page title and URL, providing potential visitors with a snapshot of what your site offers. Craft a compelling and informative description to encourage clicks and improve search engine optimization (SEO).', NULL, 4, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
('a810e4bb-47d3-4aee-adf1-3805e5bff9de', 11, 'Translations', 'hu_HU', '0', 'bool', 0, 'Enable translations in Hungarian', NULL, 2, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
('a8ff3cb6-db36-43f7-ae3f-a669086a1275', 21, 'Security', 'suspiciousWindowHours', '24', 'numeric', 0, 'Time window in hours for counting suspicious requests.', NULL, 2, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
