('ac1ecb2b-efa6-4e6a-85a4-cbfbc2c3defc', 17, 'RateLimit', 'registerNumberOfSeconds', '300', 'numeric', 0, 'Time window in seconds for registration rate limiting (300 = 5 minutes).', NULL, 2, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
('acc3ba53-469b-4f7d-8507-ad99bd992487', 1, 'Security', 'trustProxy', '0', 'bool', 0, 'Enable this setting if Willow CMS is deployed behind a proxy or load balancer that modifies request headers. When enabled, the application will trust the `X-Forwarded-For` and `X-Real-IP` headers to determine the original client IP address. Use this setting with caution, as it can expose Willow CMS to IP spoofing if untrusted proxies are allowed.', NULL, 2, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
('ad6a253b-2ef6-41a5-a5d4-5849a1e661cb', 7, 'Translations', 'et_EE', '0', 'bool', 0, 'Enable translations in Estonian', NULL, 2, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
('adfbc3d7-28c1-433d-8db0-51716d08da5b', 2, 'SitePages', 'mainMenuShow', 'root', 'select', 0, 'Should the main menu show all root pages or only selected pages?', '{\n  \"root\": \"Top Level Pages\",\n  \"selected\": \"Selected Pages\"\n}', 2, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
('b1f85a23-7861-435f-8e41-ab0d4342615d', 0, 'Email', 'reply_email', 'noreply@example.com', 'text', 0, 'The \"Reply Email\" field allows you to specify the email address that will be used as the \"Reply-To\" address for outgoing emails sent from Willow CMS. When a recipient receives an email from your website and chooses to reply to it, their response will be directed to the email address specified in this field.', NULL, 2, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
('b4a42291-2f14-43f4-82dc-65e45719c558', 6, 'SEO', 'siteName', 'Willow CMS', 'text', 0, 'This field represents the official name of your website. It is typically displayed in the title bar of web browsers and is used in various places throughout the site to identify your brand or organization. Ensure that the name is concise and accurately reflects the purpose or identity of your site.', NULL, 4, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
('b51f6fb8-6372-462f-ada8-dc751f3b75fd', 4, 'AI', 'articleSEO', '0', 'bool', 0, 'Optimize your articles and pages for search engines and social media by automatically generating SEO metadata. When enabled, the system will create a meta title, meta description, meta keywords, and tailored descriptions for Facebook, LinkedIn, Instagram, and Twitter.', NULL, 2, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
('b7cad940-ec41-451b-95de-91a7b042e62a', 1, 'SitePages', 'privacyPolicy', 'None', 'select-page', 0, 'Choose which page to show as your site Privacy Policy.', '', 2, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
