('bab35603-2c36-4dca-a015-f51ea131747c', 22, 'Security', 'suspiciousBlockHours', '24', 'numeric', 0, 'How long to block IPs that exceed the suspicious request threshold (in hours).', NULL, 2, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
('c20e9c6d-3bfc-45b9-80cd-0d390f8a3836', 14, 'Translations', 'lv_LV', '0', 'bool', 0, 'Enable translations in Latvian', NULL, 2, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
('c4a54f00-141d-4ed3-82de-ad9c8dbf7efa', 6, 'AI', 'articleTags', '0', 'bool', 0, 'Automatically generate relevant tags for your articles and pages based on their content. When you save an article or page, the system will analyze the text and create tags that best represent the main topics and keywords. These tags will then be automatically linked to the corresponding article or page, making it easier for readers to find related content on your website.', NULL, 2, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
('c6fa5e19-ba1f-4b54-ad0c-1117e67adce1', 1, 'SEO', 'siteMetakeywords', 'Default site meta keywords', 'textarea', 0, 'Metakeywords are a set of keywords or phrases that describe the content of your website. These keywords are used by search engines to index your site and improve its visibility in search results. Enter relevant and specific keywords that accurately represent the topics and themes of your site content.', NULL, 4, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
('c970bb29-ebff-45b1-84fe-cadadde5c220', 4, 'Google', 'youtubeApiKey', 'your-api-key-here', 'text', 1, 'This field is used to store your YouTube API key, which is required to access your videos to insert into post and page content.', NULL, 12, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
('d0a5f60e-bde7-43af-b80f-fc74362acd46', 3, 'Google', 'translateApiKey', 'your-api-key-here', 'text', 1, 'This field is used to store your Google API key, which is required to access and utilize the Google Cloud Translation API. The Google Cloud Translation API allows you to integrate machine translation capabilities into your content management system, enabling automatic translation of your website content into different languages.', NULL, 12, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
