('ddb7ce26-1e75-4136-9cf1-725598c870a7', 3, 'SitePages', 'mainTagMenuShow', 'root', 'select', 0, 'Should the main tag menu show all root tags or only selected tags?', '{\n  \"root\": \"Top Level Tags\",\n  \"selected\": \"Selected Tags\"\n}', 2, '2025-07-31 05:23:57', '2025-07-31 05:23:57'),
